// App.js
import React from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import Navigation from './routes/navigation/navigation.component';
import GetStarted from './components/get-started/get-started.component';
import Shop from './routes/shop';
import UsefulInformation from './UsefulInformation';
import About from './About';

const App = () => {
  return (
    <Router>
      <Navigation />
      <Routes>
        <Route path="/" element={<h1>Puppy Culture Home</h1>} />
        <Route path="/get-started" element={<GetStarted />} />
        <Route path="/shop" element={<Shop />} />
        <Route path="/useful-information" element={<UsefulInformation />} />
        <Route path="/about" element={<About />} />
      </Routes>
    </Router>
  );
};

export default App;
